# O(NM) Solution with Two Pointers

import unittest


def isSubsequence(s, t):
    index = 0
    for char in s:
        index = t.find(char, index)
        if index == -1:
            return False
        index = index + 1

    return True


class Test(unittest.TestCase):

    def test_isSubsequence(self):
        self.assertEqual(isSubsequence("leeeeetcode", ""), False)
        self.assertEqual(isSubsequence("abc", "ahbgdc"), True)
        self.assertEqual(isSubsequence("axc", "ahbgdc"), False)
        self.assertEqual(isSubsequence("", "abc"), True)
        self.assertEqual(isSubsequence("abc", ""), False)
        self.assertEqual(isSubsequence("", ""), True)

if __name__ == "__main__":

    unittest.main()
